// Tom Sampson © Clutch.Net 2023 MIT License
// 2023-09-17 00:15:34
VAR PW =
    CALCULATE(
        SELECTEDMEASURE(),
        FILTER(
            ALL(Calendar),
            Calendar[RelativeWeek] = -1
        )
    )

VAR CW = SELECTEDMEASURE()

VAR Result = IF(NOT ISBLANK(CW) && NOT ISBLANK(PW), CW - PW)

RETURN Result

